  /**
   * Generates a PDF with custom Bengali fonts.
   * @param name - The applicant's name.
   * @param content - Bengali text body.
   */
  public generatePdf(name: string, content: string): void {
    const docDefinition: any = {

      pageSize: 'A4',
      pageOrientation: 'prtrait',
      pageMargins: [20, 20, 20, 20],
      header: () => {
        return [
          this.pdfHeaderControllerOffice(),
        ]

      },

      content: [

        {
          text: content,
          style: 'body',
          font: 'NotoSerifBengali'
        },
        {
          text: 'pdfmake fayyadamuu keetiif galatoomi.',
          style: 'footer'
        }
      ],

      defaultStyle: {
        font: 'NotoSerifBengali'
      }
    };

    try {
      (pdfMake as any).createPdf(docDefinition, undefined, FONT_DEFINITIONS, (pdfMake as any).vfs).download('sanada_qaxarrii.pdf');

      console.log('[pdfMake] PDF generated successfully.');
    } catch (e) {
      console.error('[pdfMake] Error generating PDF:', e);
    }
  };



